"""
leetcode 392. Is Subsequence
https://leetcode.com/problems/is-subsequence/description/?envType=study-plan-v2&envId=top-interview-150
"""


class Solution:
    def isSubsequence(self, s: str, t: str) -> bool:

        left, right = 0, 0
        len_left, len_right = len(s), len(t)

        if len_left == 0:
            return True

        while right < len_right:
            if s[left] == t[right]:
                if left == len_left - 1:
                    return True

                left += 1
                right += 1
                continue

            right += 1

        return False


sol = Solution()
print(
    sol.isSubsequence(
        s="bcd",
        t="",
    )
)
print(sol.isSubsequence(s="axc", t="ahbgdc"))
